Math.TWO_PI = Math.PI * 2;

var canvas,
    context,
    settings = {},
    bubbles = [],
    points = [],
    turbs = [],
    turbsIndex,
    turbulence;

settings.turbulence = 125;

// ========================================================================================
// Bubble
// ----------------------------------------------------------------------------------------

function Bubble(options) {
    this.init(options);
}

Bubble.prototype = {

    init: function(options) {

        if(!options) options = {};

        //this.radius = Math.random() *  (canvas.height/250);

        var sizeOffset = 0.6;
        if(canvas.height > 1500)
          {
          var sizeOffset = 1;
          }

        this.radius = Math.random() * (8*sizeOffset);
        this.x = options.x || Math.random() * canvas.width;
        this.y = options.y || canvas.height + this.radius;
        this.vx = Math.random() * (0.03*sizeOffset);
        this.vy = 1*sizeOffset;
        //this.vy = canvas.height/2500;
        this.sway =(0.25*sizeOffset) + Math.random() * (0.25*sizeOffset); // 0.25-0.5
        this.angle = Math.random() * Math.TWO_PI;
        this.opacity = 0.05 + Math.random() * 0.2;

        return this;
    },

    update: function() {
        this.x += Math.cos(this.angle) * this.sway;
        this.y -= this.vy;
        this.angle += this.vx;
        if(this.y <= canvas.center.y) this.init();
        return this;
    },

    draw: function() {
        context.beginPath();
        context.arc(this.x, this.y, this.radius, 0, Math.TWO_PI, false);
        context.fillStyle = 'rgba(255,255,255,' + this.opacity + ')';
        context.fill();
        return this;
    },

    render: function() {
        this.update();
        this.draw();
        return this;
    }
};

